import React from "react";

const DUMMY_USERS = () => [
  { id: u1, name: Ama },
  { id: u2, name: Abena },
  { id: u3, name: Kwame },
  { id: u4, name: Michael },
];

const List = () => {
  <ul>
    {DUMMY_USERS.map((user) => (
      <li>
        = {user.id} name = {user.name}
      </li>
    ))}
  </ul>;
  console.log(DUMMY_USERS);

  return;
};

export default List;
